import "./style.css"

export const Exit = ({ listTransactions }) => {

    function infoExit() {
        const cadastroDespesas = []

        listTransactions.forEach((cadastro) => {
            if (cadastro.tipo === "Despesas") {
                cadastroDespesas.push(cadastro)
            }
        })

        const entrada = cadastroDespesas.map(({ descricao, valor, tipo }) => {
            return (
                <li className="entry">
                    <div className="salary">
                        <h3>{descricao}</h3>
                        <span>{tipo}</span>
                    </div>

                    <div className="priceAndDelete">
                        <span>R$ {valor}</span>
                    </div>
                </li>
            )
        })

        return entrada
    }

    return (
        <li className="exit">
            <div className="salary">
                <h3>Salário - Mês Dezembro</h3>
                <span>Despesa</span>
            </div>

            <div className="priceAndDelete">
                <span>R$ 6.666,0</span>
            </div>
        </li>
    )
}
